import React from 'react';
import s from './Profile.module.css';

const Profile = (props) => {

    let translateInterests={
        "sport": 'спорт',
        "creation": 'творчество',
        "music": 'музыка',
        "literature": 'литература',
        "film": 'кино',
        "science": 'наука',
        "cars": 'автомобили',
        "technology": 'техника',
        "politics": 'политика',
        "travel": 'путешествие',
        "cooking": 'кулинария',
        "art": 'искусство',
        "games": 'игры',
        "craft": 'ремесло',
        "parenting": 'материнство/отцовство'

    }

        let arr=[];
        for (let i in props.profilePage.interests){
            if (props.profilePage.interests[i]==1)
            {
                for (let u in translateInterests)
                      if (i==u) arr.push(translateInterests[u])
            }
        }
        // let showInterests=arr.map((i)=>(`${i}, `))
            let showInterests=arr.join('')

    return (
        <div>
            <div className={s.descriptionBlock}>
               <div>Имя пользователя: {props.profilePage.name}</div>
                <div>Рейтинг: {props.profilePage.rating}</div>
                <div>Интересы: {showInterests} </div>

            </div>
        </div>
    )
}


export default Profile;
